import React from 'react';
import Loader from './Loader';

function Table(props) {
  console.log('props in Table', props);
  const tableData = props.data;
  console.log('tableDta', tableData);
  // console.log('tableDta', tableData.length);


  const tData = (tableData && tableData.length) ?
    tableData.map(i => {
      return(
        <>
       <tr className="rowClass">
        <td>{i.transactionId}</td>
        <td>{i.userName}</td>
        <td>{i.paymentMode}</td>
        <td>{i.amount}</td>
      </tr>
      <style jsx>{`
             .rowClass , td{
            border: 1px solid #000 !important;
            padding: 5px;
            text-align: center;
        }
        `}</style>
      </>
         )
       }) : <p>Loading ...</p>

 return (
    <div className="tableDiv">
       <table >
         <tr>
           <th>Transaction ID</th>
           <th>User Name</th>
           <th>Payment Mode</th>
           <th>Amount</th>
         </tr>
         <tbody>
           {tData}
         </tbody>
       </table>
       <style jsx>{`
       table, th, td {
           border: 1px solid #7a7a7a;
           border-collapse: collapse;
           background: #ccc;
           font-weight: normal;
           font-family: sans-serif;
           font-size: 12px;
           width: 100%;
         }
          th {
           border-bottom: 2px solid #010101;
          }
          tbody {
           overflow-x: auto;
          }
         th, td {
           padding: 5px;
           text-align: center;
           width: 25%;
         }
           .rowClass{
          border: 1px solid #000 !important;
          padding: 5px;
          text-align: center;
      }

         .tableDiv {
           background: #d9d8d9;
           margin: auto;
           width: 75%;
           padding: 21px;
           margin-top: 15px;
           height: 9em;
         }
         th {
          position: sticky;
          top: 0;
          z-index: 2;
        }

.fixed_header{
  width: 400px;
  table-layout: fixed;
  border-collapse: collapse;
}

.fixed_header tbody{
display:block;
width: 100%;
overflow: auto;
height: 100px;
}

.fixed_header thead tr {
 display: block;
}

.fixed_header thead {
background: black;
color:#fff;
}

.fixed_header th, .fixed_header td {
padding: 5px;
text-align: left;
width: 200px;
}

             `}</style>
           </div>

      )
}

export default Table;
